import NavBar from "../components/layout/navBar";
import classes from './Home.module.css';
import PostImage from '../assets/images/post.png';

function Home() {
  return (
    <div>
      <NavBar />
      <div className={classes.header}>
        <div className={classes.headerLeft}>
          <p>Pear Programming is a place for designers and developers to share ideas, find inspiration, and work together to build their skills and resumes.</p>
        </div>
        <div className={classes.headerRight}>
          <img src={PostImage}/>
        </div>
      </div>
    </div>
  );
}

export default Home;
